webpackJsonp([83050626864197],{1196:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/google-analytics-unveiled/index.md absPath of file >>> MarkdownRemark",html:'<p>Google have released the google analytics on their google code service – which basically means they’re opening up the API &#x26; stuff like that in a similar way to the way google maps works, and allows you to configure and customise it.</p>\n<p><a href="http://analytics.blogspot.com/2008/09/decoding-google-analytics.html">http://analytics.blogspot.com/2008/09/decoding-google-analytics.html</a></p>\n<p>I wonder what <a href="http://www.aboutnico.be/">Nicolas Lierman</a> (the guy who spent months reverse engineering the API to build an AIR Application version of Google Analytics) feels about them just making it open... (Gutted, I bet)</p>\n<p><strong>Also:</strong> Ever wondered what the difference is between Google Analytics and Urchin software? <a href="http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&#x26;answer=55536">http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&#x26;answer=55536</a></p>',frontmatter:{title:"Google Analytics — Unveiled.",date:"September 12, 2008",tags:["apis","google-analytics","google-code"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/google-analytics-within-flexflash-applications/",tags:["flash","flex","air","google-analytics"],title:"Google Analytics within Flex/Flash Applications",image:null,date:"2009-02-05T13:30:06.000Z"}},next:{frontmatter:{path:"/blog/google-analytics-class-as3/",tags:["actionscript","externalinterface"],title:"Google Analytics Class - AS3",image:null,date:"2008-03-01T17:25:24.000Z"}}}}}});
